import React, { useState } from "react";
import "./Homestyle.css";
import NotSignedIn from "./Nav/NotSignedIn";
import SignedIn from "./Nav/SignedIn";
import { Link } from "react-router-dom";
const Home = (props) => {
  const [isLogin,setIsLogin] = useState(false);
  return (
    <div>
     { isLogin==false?(
        <NotSignedIn /> 
      ):<SignedIn />}
    </div>
  );
};

export default Home;
